        public virtual ICollection<CoreAddress> CoreAddress { get; set; }
        public virtual CoreCountry CoreCountry { get; set; }
        public virtual ICollection<CoreCity> CoreCity { get; set; }
    }

    public partial class CoreStateConfiguration : IEntityTypeConfiguration<CoreState>
    {
        public void Configure(EntityTypeBuilder<CoreState> builder)
        {
            builder.Property(e => e.CreatedOn).HasColumnType("datetime");

            builder.Property(e => e.ModifiedOn).HasColumnType("datetime");

            builder.Property(e => e.Name).HasMaxLength(100);

            builder.HasOne(d => d.Country)
                .WithMany(p => p.CoreState)
                .HasForeignKey(d => d.CountryId)
                .HasConstraintName("FK_CoreState_Country");
        }

    }

